  const Design = {color:'white',textAlign:'center'};
  return (
    <div>
      <html>
        <body>
          <h1 style = {Design}>Resume</h1>
          <Description/>
          <Transaction/>
        </body>
      </html>


    </div>

  );
}

export default App;
